import React from 'react';
import './App.css';
import * as questions from '../questions.json';

interface AppProps {
  noOfQuestions : number
}

interface AppState {
  noOfCorrectResponses : number 
}

export default class App extends React.Component<AppProps,AppState> {
  constructor(props: AppProps) {
    super(props);
    this.state = {
      noOfCorrectResponses: 0
    };
  }
  render() {
    return(
      <div className = 'App'>
        <div className = 'App-header'>
          {this.state.noOfCorrectResponses},{this.props.noOfQuestions}
        </div>
      </div>
    )
  }
}
